import React, { Component } from 'react';
import Chekbox from './chekboxhtml/chekboxhtml';

class Checkbox extends Component {
    handleCheckboxChange = event =>
    this.setState({ checked: event.target.checked }) 

    constructor(props)
    {
        super(props)
        this.state = {
           chekboxarray: [
              {
                  class: '',
                  checked: false,

              }
            ],
        }
    }
    render() {

        return (
            <>
              <Chekbox Checkbox={this.state.chekboxarray} changes={this.handleCheckboxChange}/>
            </>
        );
    }
}

export default Checkbox;
